import {Component, OnInit} from '@angular/core';
import {TransporterService} from "../../logic-components/services/TransporterService";
import {Transporter} from "../../logic-components/classes/Transporter";

@Component({
  selector: 'app-transporter-list',
  templateUrl: './transporter-list.component.html',
  styleUrls: ['./transporter-list.component.css']
})
export class TransporterListComponent implements OnInit {
  transporters: Transporter[] = [];

  constructor(private transporterService: TransporterService) {}

  ngOnInit() {
    this.transporterService.getTransporters().subscribe(
      (data) => {
        this.transporters = data;
      },
      (error) => {
        console.error('Error fetching transporters', error);
      }
    );
  }

  updateTransporter(transporter: Transporter) {
    this.transporterService.updateTransporter(transporter).subscribe(
      (updatedTransporter) => {
        // Actualización exitosa, puedes manejar la respuesta como lo necesites
        console.log('Transporter updated:', updatedTransporter);
      },
      (error) => {
        console.error('Error updating transporter', error);
      }
    );
  }
}

